// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;
import {StableToken} from "./StableToken.sol";
import {CollateralVault} from "./CollateralVault.sol";
import {AggregatorV3Interface} from "@chainlink/contracts/src/v0.8/shared/interfaces/AggregatorV3Interface.sol";

contract LoanManager {
    StableToken public stableToken;
    CollateralVault public collateralVault;
    AggregatorV3Interface internal priceFeed;
    address private stableTokenAddress;
    address private collateralVaultAddress;
    address private loanManagerAddress;

    event TransferTokenCSB(
        address indexed from,
        address indexed to,
        uint256 value
    );
    event DepositCollateral(
        address indexed from,
        address indexed to,
        uint256 value
    );
    event DecreaseCollateral(address indexed account, uint256 ethereum);

    error InsufficientBalance(address acoount);
    error InsufficientSupply(address stableTokenAddress);

    modifier onlyUser() {
        require(msg.sender != loanManagerAddress, "Only user can call this");
        _;
    }

    //Kegunaan dari underscore : Untuk membedakan antara parameter fungsi (misal: _stableTokenAddress) dan variabel state (misal: stableTokenAddress) di dalam kontrak.
    constructor(address _stableTokenAddress, address _collateralVaultAddress) {
        loanManagerAddress = msg.sender;
        stableToken = StableToken(_stableTokenAddress);
        collateralVault = CollateralVault(_collateralVaultAddress);
        stableTokenAddress = address(stableToken);
        collateralVaultAddress = address(collateralVault);
        priceFeed = AggregatorV3Interface(
            0x694AA1769357215DE4FAC081bf1f309aDC325306
        );
    }

    function getETHtoUSD(uint256 ethAmount) public view returns (uint256) {
        (, int256 price, , , ) = priceFeed.latestRoundData();
        // price is 8 decimals, ethAmount is 18 decimals
        return (ethAmount * uint256(price)) / 1e26; // (eth * price) / 1e18 / 1e8
    }

    function depositCollateral() external payable onlyUser {
        if (msg.value <= 0) {
            revert InsufficientBalance(msg.sender);
        }

        uint256 ETHtoUSDConvertionRate = getETHtoUSD(msg.value);
        uint256 CBSTokenAmount = ETHtoUSDConvertionRate * 1e18;

        if (stableToken.totalSupply() <= CBSTokenAmount) {
            revert InsufficientSupply(stableTokenAddress);
        }

        collateralVault.addUserCollateral{value: msg.value}(
            msg.sender,
            msg.value
        );

        // Perlu di approve dulu LoanManager contractnya, jika ingin di gunakan
        // Kenapa LoanManager perlu di approve ? Karena LoanManager lah yang memanggil contract stableToken berserta function transferForm
        stableToken.tokenTransferFrom(
            stableTokenAddress,
            msg.sender,
            CBSTokenAmount
        );

        emit DepositCollateral(msg.sender, collateralVaultAddress, msg.value);
        emit TransferTokenCSB(stableTokenAddress, msg.sender, CBSTokenAmount);
    }

    function unlockCollateral(uint256 csbToken) external payable onlyUser {
        uint256 ETHtoUSDConvertionRate = getETHtoUSD(1e18);
        uint256 CSBTokenToETH = ((csbToken / 1e18) / ETHtoUSDConvertionRate) *
            1e18;

        if (stableToken.balanceOf(msg.sender) < csbToken) {
            revert InsufficientBalance(msg.sender);
        }

        stableToken.transferFrom(msg.sender, stableTokenAddress, csbToken);
        emit TransferTokenCSB(msg.sender, stableTokenAddress, csbToken);

        collateralVault.withdrawCollateral(msg.sender, CSBTokenToETH);

        emit DecreaseCollateral(msg.sender, CSBTokenToETH);
    }
}

contracts/LoanSystemFactory.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

import "./StableToken.sol";
import "./CollateralVault.sol";
import "./LoanManager.sol";

contract LoanSystemFactory {
    event SystemDeployed(
        address indexed stableToken,
        address indexed collateralVault,
        address indexed loanManager,
        address owner
    );

    struct DeployedContracts {
        address stableToken;
        address collateralVault;
        address loanManager;
    }

    mapping(address => DeployedContracts) public deployedSystems;

    function deployLoanSystem()
        external
        returns (
            address stableTokenAddress,
            address collateralVaultAddress,
            address loanManagerAddress
        )
    {
        // 1. Deploy StableToken dengan Factory sebagai admin sementara
        StableToken stableToken = new StableToken(address(this));
        stableTokenAddress = address(stableToken);

        // 2. Deploy CollateralVault
        CollateralVault collateralVault = new CollateralVault(
            stableTokenAddress,
            msg.sender
        );
        collateralVaultAddress = address(collateralVault);

        // 3. Deploy LoanManager
        LoanManager loanManager = new LoanManager(
            stableTokenAddress,
            collateralVaultAddress
        );
        loanManagerAddress = address(loanManager);

        // 4. Set LoanManager address di CollateralVault
        collateralVault.setLoanManager(loanManagerAddress);

        // 5. Grant MINTER_ROLE ke LoanManager (Factory punya admin role)
        stableToken.grantRole(stableToken.MINTER_ROLE(), loanManagerAddress);

        // 5.5. Approve LoanManager untuk menggunakan token dari StableToken contract
        stableToken.approveLoanManagerUnlimited(loanManagerAddress);

        // 6. Transfer ownership ke user dan renounce factory admin
        stableToken.grantRole(stableToken.DEFAULT_ADMIN_ROLE(), msg.sender);
        stableToken.renounceRole(
            stableToken.DEFAULT_ADMIN_ROLE(),
            address(this)
        );

        // 7. Simpan addresses
        deployedSystems[msg.sender] = DeployedContracts({
            stableToken: stableTokenAddress,
            collateralVault: collateralVaultAddress,
            loanManager: loanManagerAddress
        });

        emit SystemDeployed(
            stableTokenAddress,
            collateralVaultAddress,
            loanManagerAddress,
            msg.sender
        );

        return (stableTokenAddress, collateralVaultAddress, loanManagerAddress);
    }

    function getDeployedSystem(
        address owner
    )
        external
        view
        returns (
            address stableToken,
            address collateralVault,
            address loanManager
        )
    {
        DeployedContracts memory system = deployedSystems[owner];
        return (system.stableToken, system.collateralVault, system.loanManager);
    }
}

contracts/StableToken.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/ERC20Burnable.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/ERC20Pausable.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";

contract StableToken is ERC20, ERC20Burnable, ERC20Pausable, AccessControl {
    bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE");
    bytes32 public constant PAUSER_ROLE = keccak256("PAUSER_ROLE");
    address public ownerAddress;

    event Mint(address indexed to, uint256 amount);
    event Pause(address account);
    event Unpause(address account);
    event TranferToken(
        address indexed from,
        address indexed to,
        uint256 amount
    );

    constructor(address initialOwner) ERC20("ColStable", "CSB") {
        ownerAddress = initialOwner;
        _grantRole(DEFAULT_ADMIN_ROLE, initialOwner);
        _grantRole(MINTER_ROLE, initialOwner);
        _grantRole(PAUSER_ROLE, initialOwner);

        uint256 initialSupply = 1_000_000_000 * 10 ** decimals();
        _mint(address(this), initialSupply);
    }

    function mint(address to, uint256 amount) public {
        require(
            hasRole(MINTER_ROLE, msg.sender) ||
                hasRole(DEFAULT_ADMIN_ROLE, msg.sender),
            "No minter or admin role"
        );
        emit Mint(to, amount);
        _mint(to, amount);
    }

    function pause() public {
        require(
            hasRole(PAUSER_ROLE, msg.sender) ||
                hasRole(DEFAULT_ADMIN_ROLE, msg.sender),
            "No pauser or admin role"
        );
        emit Pause(msg.sender);
        _pause();
    }

    function unpause() public {
        require(
            hasRole(PAUSER_ROLE, msg.sender) ||
                hasRole(DEFAULT_ADMIN_ROLE, msg.sender),
            "No pauser or admin role"
        );
        emit Unpause(msg.sender);
        _unpause();
    }

    function tokenTransferFrom(
        address from,
        address to,
        uint256 value
    ) external {
        transferFrom(from, to, value);
        emit TranferToken(from, to, value);
    }

    function approveLoanManagerUnlimited(address loanManager) external {
        require(hasRole(DEFAULT_ADMIN_ROLE, msg.sender), "No admin role");
        _approve(address(this), loanManager, type(uint256).max);
    }

